import Signup from './pages/adminpages/signup/Signup';

function App() {
  const location = useLocation();

  const [user, setuser] = useState('user')




  return (
    <div className="App">
     <Routes></Routes>
      <Navbar />
      <Routes>




        <Route exact path='/home' element={<Home />} />
        <Route path='/all-mobiles' element={<AllMobiles />} />

